import { useState, useEffect} from 'react';

export default function Fetch(){
    const [movies, setMovies] = useState([]);

    useEffect(() => {
        fetch('https://imdb146.p.rapidapi.com/v1/find/')
        .then((res) => {
            return res.json();
        })
        .then((data) => {
            console.log(data);
            setMovies(data);
        });
    }, []);
    return (
        <div>
            <ul>
            {movies.map((movie) => (
                <li key={movie}>
                    {movie.name}
                </li>
            ))}
            </ul>
        </div>
    )
}
